INSERT INTO `pages` VALUES (1,'index','English version of this page','homepage CMS developed by HostingBE','CMS, php,slim,hostingbe','page-template.twig','<h1 class=\"pt-2 pb-2\">This is your first homepage</h1>\r\n<p>Change the content of this page in the manager control panel in pages overview!</p>','y','2022-10-01','en','2022-10-23 13:54:22'),(3,'index','titel van deze pagina','omschrijving van deze pagina','keywords van deze pagina','page-template.twig','dit is een mooie pagina ja deze is on NL','y','2022-10-29','nl','2022-10-29 15:37:50'),(5,'kanweg','plaatje','met een plaatje','keywords,kan weg,title,description','page-template.twig','<p>hier wat tekst</p>\r\n<pre class=\"language-php\"><code>&lt;?php\r\n\r\nfunction ($fiets) {\r\necho \"hier komt de \" . $fiets; \r\n}\r\n\r\nprint \"klaar\";\r\n?&gt;</code></pre>\r\n<p>hier nog een nieuw plaatjes met de tekst die we hebbe</p>\r\n<p><img src=\"https://cms.hostingbe.nl/uploads/6ad13745599f2629.jpg\" alt=\"\" width=\"800\" height=\"500\"></p>\r\n<p>hier een plaatje</p>\r\n<p><img class=\"img-fluid rounded float-end\" src=\"https://cms.hostingbe.nl/uploads/29fa5c469dcfda67.jpg\" alt=\"hier het plaatje\" width=\"800\" height=\"434\"></p>','y','2022-12-16','en','2022-12-16 20:34:05'),(6,'kanweg2','deze kan ook weg','deze kan ook weg','keywords,kan weg,title,description','page-template.twig','<h1 class=\"pt-2 pb-2\">Heading van de pagina</h1>\r\n<p>hieronder komt het plaatje van de pagina</p>\r\n<p>&nbsp;</p>\r\n<p><img class=\"img-fluid rounded\" src=\"https://cms.hostingbe.nl/uploads/4cd6e1983adbfa05.png\" border=\"0\" alt=\"\"></p>','y','2022-12-18','en','2022-12-18 19:15:36'),(8,'artikel','titel van het artikel','dit is het onderwerp','artikel,omschrijving,description,title','page-template.twig','<p>Hier een pagina met de description en title van het <a href=\"/support-6-dit-is-de-eerste-titel-van-het-artikel/\" title=\"artikel\">artikel</a> op de pagina en hier komen de <a href=\"/blog-1-how-to-create-rich-snippets/\" title=\"rich snippets\">rich snippets</a>. Hier kan het ook om een <a href=\"/index\" title=\"CMS\">CMS</a> gaan.</p>\r\n\r\n<p>Ik snap alleen nog niet waarom die het woord <a href=\"/support-6-dit-is-de-eerste-titel-van-het-artikel/\" title=\"artikel\">artikel</a> niet pakt.</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\n','y','2023-07-21','en','2023-07-21 11:09:21'),(9,'lege-pagina','dit is een lege pagina voor het CMS','dit is een omschrijving van de lege pagina','subject,lege pagina,onderwerp,mijn fiets','page-template.twig','<p>Hier komt de content van de pagina wat een goed <a href=\"/support-7-dit-is-de-eerste-titel-van-het-artikel/\" title=\"artikel\">artikel</a> is om te schijven binnen deze support artikelen.</p>\n','y','2023-07-21','en','2023-07-21 11:48:49');
